package mx.org.ieem.activity.eventos;

import android.content.Intent;
import android.net.Uri;
import android.os.Bundle;
import android.view.View;
import android.widget.AdapterView;
import android.widget.Button;
import android.widget.ListView;
import android.widget.Toast;

import androidx.annotation.Nullable;
import androidx.appcompat.app.AppCompatActivity;

import java.util.ArrayList;

import mx.org.ieem.R;
import mx.org.ieem.activity.main.MainActivity;
import mx.org.ieem.adapters.EventosAdapter;
import mx.org.ieem.data.sqllite.models.eventos.eventos;

public class EventosActivity extends AppCompatActivity
{
    EventosAdapter customAdapter;
    public static ArrayList<eventos> listapersonas;
    ListView listEventos;
    Button atras;

    @Override
    protected void onCreate(@Nullable Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_eventos);
        atras = (Button) findViewById(R.id.button_regresar_eventos);
        listapersonas=new ArrayList<eventos>();
        listapersonas.add(new eventos("1", "Juegos Interactivos sobre Valores de la Democracia","https://www.ieem.org.mx/pdf/2020/Guia_operativa_Juegos_interactivos.pdf"," data:image/png;base64,"));
        listapersonas.add(new eventos("1", "Torneo Virtual MX de Debate 2020","https://www.ine.mx/wp-content/uploads/2020/06/deceyec-torneo-Virtual-mx-Debate-2020-18-29a%C3%B1os.pdf", " data:image/png;base64,"));
        listapersonas.add(new eventos("1", "Actividades en Linea para niños y niñas; INE","https://www.ieem.org.mx/pdf/2020/Eventos_INE_Ninos_as.pdf"," data:image/png;base64,"));
        listapersonas.add(new eventos("1", "Lista de actividades de difusión de la cultura democrática de la Dirección Ejecutiva de Capacitación Electoral y Educación Cívica del INE","https://www.ieem.org.mx/pdf/2020/Press_kit.pdf"," data:image/png;base64,"));
        listapersonas.add(new eventos("1", "Catálogo General de Publicaciones del INE","https://repositoriodocumental.ine.mx/xmlui/bitstream/handle/123456789/113640/CatalogoINE.pdf?sequence=3&isAllowed=y"," data:image/png;base64,"));
        listapersonas.add(new eventos("1", "Convocatoria de ingreso a la Décima Primera Generación de la Maestría en Derecho Electoral","https://www.ieem.org.mx/pdf/2020/CFDE_Convocatoria%20MDEweb.pdf"," data:image/png;base64,"));
        customAdapter = new EventosAdapter(this);
        listEventos = (ListView)findViewById(R.id.listView_eventos);
        listEventos.setAdapter(customAdapter);

        listEventos.setOnItemClickListener(new AdapterView.OnItemClickListener() {
            @Override
            public void onItemClick(AdapterView<?> parent, View view, int position, long id) {
                Intent browserIntent = new Intent(Intent.ACTION_VIEW, Uri.parse(listapersonas.get(position).getUrl()));
                startActivity(browserIntent);
            }
        });

        atras.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                Intent browserIntent =  new Intent(v.getContext(), MainActivity.class);
                startActivity(browserIntent);
            }
        });
    }
}
